import React, { useState } from "react";
import styles from "../styles/NewTXNPopup.module.css";
import ReactDom from "react-dom";
import Input_field from "./Input_field";

export default function NewTXNPopup(props) {
  const [category, setCategory] = useState("");
  const [inputStates, setInputStates] = useState({});

  if (!props.displayNewTXN) return null;

  const subcategories = {
    Housing: [
      "Mortgage",
      "Rent",
      "Home/renters insurance",
      "Utilities",
      "Maintenance",
      "Misc",
    ],
    Transportation: [
      "Gas",
      "Car payment",
      "Car insurance",
      "Rideshare",
      "Misc",
    ],
    Food: ["Groceries", "Restaurants/Take-out", "Misc"],
    Bills: ["Electric", "Water", "Gas", "Misc"],
    Healthcare: ["Medical", "Dental", "Prescription", "Misc"],
    Entertainment: ["Hobby", "Games", "Travel", "Concerts", "Misc"],
    "Personal care": ["Hygiene products", "Haircut", "Spa/Salon", "Misc"],
    Clothing: ["Apparel", "Shoes", "Misc"],
    Education: [
      "Tuition",
      "Books",
      "School Supplies",
      "Tutoring/Online Help",
      "Misc",
    ],
    "Charitable donations": ["Non-profit", "Religious", "Misc"],
    Savings: [
      "IRA",
      "401k",
      "HRA/HSA",
      "529 Plan",
      "Bonds",
      "CDs",
      "Money-Market",
      "Mutual Funds",
      "ETFs",
      "Stocks",
    ],
    Misc: [],
  };

  const handleInputChange = (iname, ivalue) => {
    setInputStates({ ...inputStates, [iname]: ivalue });
  };

  const handleSubmit = () => {
    console.log(inputStates);
  };

  return ReactDom.createPortal(
    <>
      <div className={styles.PopupBackground}></div>
      <div className={styles.TXNPopup}>
        <h1>New Transaction</h1>
        <hr />
        <form className={styles.new_txn_form} id="new_txn_form">
          <div>
            <label>*Transaction Type: </label>
            <select
              name="TXN_types"
              id="TXN_types"
              onChange={(e) => {
                handleInputChange("Transaction_type", e.target.value);
              }}
            >
              <option disabled selected value>
                -- select an option --
              </option>
              <option value="Income">Income</option>
              <option value="Expense">Expense</option>
              <option value="Transfer">Transfer</option>
              <option value="Refund">Refund</option>
              <option value="Investment">Investment</option>
            </select>
          </div>
          <div>
            <label>*Amount: </label>
            <input
              type="number"
              placeholder="enter transaction amount"
              onChange={(e) => {
                handleInputChange("Amount", e.target.value);
              }}
            ></input>
          </div>

          <div>
            <label>*Category: </label>
            <select
              name="TXN_types"
              id="TXN_types"
              onChange={(e) => {
                handleInputChange("Category", e.target.value);
              }}
            >
              <option disabled selected value>
                -- select an option --
              </option>
              <option value="Housing">Housing</option>
              <option value="Transportation">Transportation</option>
              <option value="Food">Food</option>
              <option value="Bills">Bills</option>
              <option value="Healthcare">Healthcare</option>
              <option value="Entertainment">Entertainment</option>
              <option value="Personal care">Personal care</option>
              <option value="Clothing">Clothing</option>
              <option value="Education">Education</option>
              <option value="Charitable donations">Charitable donations</option>
              <option value="Savings">Savings</option>
              <option value="Misc">Misc</option>
            </select>
          </div>

          <div>
            <label>*Subcategory: </label>
            <select
              name="TXN_types"
              id="TXN_types"
              onChange={(e) => {
                handleInputChange("Subcategory", e.target.value);
              }}
            >
              <option disabled selected value>
                -- select an option --
              </option>
              {category !== "" &&
                subcategories[category].map((item) => (
                  <option value={item}>{item}</option>
                ))}
            </select>
          </div>

          <div>
            <label>Description (optional): </label>
            <input
              type="text"
              onChange={(e) => {
                handleInputChange("Description", e.target.value);
              }}
            ></input>
          </div>

          <button type="button" onClick={handleSubmit}>
            Submit
          </button>
        </form>
      </div>
    </>,
    document.getElementById("newTXNPortal")
  );
}
